<script>
function $_GET(param) {
	var vars = {};
	window.location.href.replace( location.hash, '' ).replace( 
		/[?&]+([^=&]+)=?([^&]*)?/gi, // regexp
		function( m, key, value ) { // callback
			vars[key] = value !== undefined ? value : '';
		}
	);

	if ( param ) {
		return vars[param] ? vars[param] : null;	
	}
	return vars;
}

var $_GET = $_GET()
lang = $_GET['lang']
switch(lang) {
   case 'fr':

     document.getElementById('loadL').innerHTML = 'V&eacute;rifiez votre connexion &agrave; Internet et r&eacute;essayez.';
     break;
   default:
     document.getElementById('loadM').innerHTML = "Sorry, we couldn't connect to Skype.";
     document.getElementById('loadL').innerHTML = 'Please check your internet connection and try again.';
     break;
}
